import styled from "@emotion/styled";

import "./App.css";

export default function App() {
  return (
    <>
      <Title>키보드</Title>
      <SubTitle>들어보고 구매하는 키보드 스토어</SubTitle>
    </>
  );
}

const Title = styled.div`
  font-weight: bold;
  font-size: 20px;
  text-align: center;
`;

const SubTitle = styled.div`
  margin-top: 16px;
  font-weight: bold;
  font-size: 12px;
  text-align: center;
`;
